import React from 'react'
import Navbar from './components/Navbar';
import Hero from './components/Hero';
import Analytics from './components/Analytics';
import News from './components/News';

function App() {
  return (
    <div>
      <Navbar/>
      <Hero/>
      <Analytics/>
      <News/>
    </div>
  );
}

export default App;
